        if(this.invalidateTimerID < 0) {
            this.invalidateTimerID = window.setTimeout(function() {
                this.Invalidate();
            }.aspxBind(this), 0);
        }

        if(!ASPx.IsExists(this.cache[key])) {
            if(!ASPx.IsExists(args))
                args = [ ];
            this.cache[key] = getObjectFunc.apply(context, args);
        }
        return this.cache[key];
