            htmlEvent: htmlEvent,
            wndWidth: ASPx.GetDocumentClientWidth(),
            wndHeight: ASPx.GetDocumentClientHeight(),
            prevWndWidth: this.prevWndWidth,
            prevWndHeight: this.prevWndHeight,
