                html = "";

            html += "<div class='" + ASPx.SpreadsheetCssClasses.ComplexBoxContainer + "' ";
            html += "style=\"";
            html += "width:" + complexBoxPosition.width + "px;";
            html += "height:" + complexBoxPosition.height + "px;";
