                html = html.replace(/<p>&nbsp;<\/p>/gi, '<br /><br />');
                html = html.replace(/<font\s*>([^<>]+)<\/font>/gi, '$1');
                html = html.replace(/<span\s*><span\s*>([^<>]+)<\/span><\/span>/ig, '$1');
